UPDATE VRAP.RCNT_RECN_VAR VAR SET ( VAR.ADMN_ADJ_AMT, VAR.BASE_ADJ_AMT, VAR.CTRC_ADJ_AMT, VAR.FRMLY_ADJ_AMT, VAR.PERF_ADJ_AMT, VAR.PRC_PTCT_ADJ_AMT, VAR.RX_UNIT_QTY, VAR.RX_CNT_QTY, VAR.LAST_UPDT_USER_ID, VAR.LAST_UPDT_TS ) = ( SELECT COALESCE(OUT.ADMN_DISC_ADJ_AMT,0) ADMINADJ, COALESCE(OUT.BASE_DISC_ADJ_AMT,0) BASEADJ, COALESCE(OUT.CTRC_DISC_ADJ_AMT,0) CTRCADJ, COALESCE(OUT.FRMLY_DISC_ADJ_AMT,0) FRMLYADJ, COALESCE(OUT.PERF_DISC_ADJ_AMT,0) PERFADJ, COALESCE(OUT.PRC_PTCT_DISC_ADJ_AMT,0) PRCADJ, COALESCE(OUT.UQ_QTY,0) QTY, COALESCE(OUT.CLM_TYP_CD,0) RXS, 'INFA', CURRENT TIMESTAMP FROM VRAP.RCNT_RECN_VAR VARIN LEFT JOIN ( SELECT SUM(EXT.ADMN_DISC_ADJ_AMT) ADMN_DISC_ADJ_AMT, SUM(EXT.BASE_DISC_ADJ_AMT) BASE_DISC_ADJ_AMT, SUM(EXT.CTRC_DISC_ADJ_AMT) CTRC_DISC_ADJ_AMT, SUM(EXT.FRMLY_DISC_ADJ_AMT) FRMLY_DISC_ADJ_AMT, SUM(EXT.PERF_DISC_ADJ_AMT) PERF_DISC_ADJ_AMT, SUM(EXT.PRC_PTCT_DISC_ADJ_AMT) PRC_PTCT_DISC_ADJ_AMT, SUM(EXT.UQ_QTY) UQ_QTY, COUNT(EXT.CLM_TYP_CD) CLM_TYP_CD,--- changed from SUM to COUNT as per PSR.TF.10307, ASSC.RECN_GID, ASSC.RECN_OBJ_GID FROM VRAP.RCNT_RECN_EXTN_CLM EXT, VRAP.RCNT_RECN_CLM_ASSC ASSC, SESSION.RCNT_RECN_PARAM_TEMP PRM WHERE ASSC.RECN_GID = EXT.RECN_GID and ASSC.INV_ID = EXT.INV_ID and ASSC.HVST_ID = EXT.HVST_ID and ASSC.CLM_GID = EXT.CLM_GID and EXT.RECN_SCRB_CD <> $$PARM_SCRB_CD and EXT.RECN_GID = PRM.RECN_GID and ASSC.RECN_GID = PRM.RECN_GID AND ASSC.RECN_OBJ_TYP_CD = 2 GROUP BY ASSC.RECN_GID, ASSC.RECN_OBJ_GID ) OUT ON VARIN.RECN_GID = OUT.RECN_GID AND VARIN.RECN_VAR_GID = OUT.RECN_OBJ_GID WHERE VAR.RECN_GID = VARIN.RECN_GID AND VAR.RECN_VAR_GID = VARIN.RECN_VAR_GID ) WHERE EXISTS ( SELECT 1 FROM ( SELECT DISTINCT ASSC.RECN_OBJ_GID, ASSC.RECN_GID FROM VRAP.RCNT_RECN_CLM_ASSC ASSC, VRAP.RCNT_RECN_EXTN_CLM EXT, SESSION.RCNT_RECN_PARAM_TEMP PRM WHERE ASSC.RECN_GID = EXT.RECN_GID AND ASSC.INV_ID = EXT.INV_ID AND ASSC.HVST_ID = EXT.HVST_ID and ASSC.CLM_GID = EXT.CLM_GID and EXT.RECN_SCRB_CD = $$PARM_SCRB_CD and EXT.RECN_GID = PRM.RECN_GID and ASSC.RECN_GID = PRM.RECN_GID AND ASSC.RECN_OBJ_TYP_CD = 2 ) ASSIN WHERE VAR.RECN_GID = ASSIN.RECN_GID AND VAR.RECN_VAR_GID = ASSIN.RECN_OBJ_GID ) ;
COMMIT;
-- Update DISPUTE summaries on VRAP.RCNT_RECN_DSPT
UPDATE VRAP.RCNT_RECN_DSPT DSPT SET (DSPT.ADMN_ADJ_AMT, DSPT.BASE_ADJ_AMT, DSPT.CTRC_ADJ_AMT, DSPT.FRMLY_ADJ_AMT, DSPT.PERF_ADJ_AMT, DSPT.PRC_PTCT_ADJ_AMT ,DSPT.ADMN_MTCH_AMT, DSPT.BASE_MTCH_AMT, DSPT.CTRC_MTCH_AMT, DSPT.FRMLY_MTCH_AMT, DSPT.PERF_MTCH_AMT, DSPT.PRC_PTCT_MTCH_AMT , DSPT.RX_UNIT_QTY, DSPT.RX_CNT_QTY ,DSPT.ADJ_RX_CNT_QTY, DSPT.MTCH_RX_CNT_QTY--- added new as part of PSR.TF.10309 , DSPT.LAST_UPDT_USER_ID, DSPT.LAST_UPDT_TS) = ( SELECT COALESCE(OUT.ADMN_DISC_ADJ_AMT,0) ADMINADJ,COALESCE(OUT.BASE_DISC_ADJ_AMT,0) BASEADJ,COALESCE(OUT.CTRC_DISC_ADJ_AMT,0) CTRCADJ ,COALESCE(OUT.FRMLY_DISC_ADJ_AMT,0) FRMLYADJ, COALESCE(OUT.PERF_DISC_ADJ_AMT,0) PERFADJ,COALESCE(OUT.PRC_PTCT_DISC_ADJ_AMT,0) PRCADJ ,COALESCE(OUT.ADMN_DISC_MTCH_AMT,0) ADMINMTCH,COALESCE(OUT.BASE_DISC_MTCH_AMT,0) BASEMTCH, COALESCE(OUT.CTRC_DISC_MTCH_AMT,0) CTRCMTCH ,COALESCE(OUT.FRMLY_DISC_MTCH_AMT,0) FRMLYMTCH, COALESCE(OUT.PERF_DISC_MTCH_AMT,0) PERFMTCH, COALESCE(OUT.PRC_PTCT_MTCH_DISC_AMT,0) PRCMTCH ,COALESCE(OUT.UQ_QTY,0) QTY, COALESCE(OUT.CLM_TYP_CD,0) RXS ,COALESCE(OUT. ADJ_RX_CNT_QTY,0), COALESCE(OUT.MTCH_RX_CNT_QTY,0)--- added new as part of PSR.TF.10309 ,'INFA', CURRENT TIMESTAMP FROM VRAP.RCNT_RECN_DSPT DSPTIN LEFT JOIN (SELECT SUM(EXT.ADMN_DISC_ADJ_AMT) ADMN_DISC_ADJ_AMT, SUM(EXT.BASE_DISC_ADJ_AMT) BASE_DISC_ADJ_AMT, SUM(EXT.CTRC_DISC_ADJ_AMT) CTRC_DISC_ADJ_AMT , SUM(EXT.FRMLY_DISC_ADJ_AMT) FRMLY_DISC_ADJ_AMT, SUM(EXT.PERF_DISC_ADJ_AMT) PERF_DISC_ADJ_AMT , SUM(EXT.PRC_PTCT_DISC_ADJ_AMT) PRC_PTCT_DISC_ADJ_AMT, SUM(EXT.ADMN_DISC_MTCH_AMT) ADMN_DISC_MTCH_AMT , SUM(EXT.BASE_DISC_MTCH_AMT) BASE_DISC_MTCH_AMT, SUM(EXT.CTRC_DISC_MTCH_AMT) CTRC_DISC_MTCH_AMT , SUM(EXT.FRMLY_DISC_MTCH_AMT) FRMLY_DISC_MTCH_AMT, SUM(EXT.PERF_DISC_MTCH_AMT) PERF_DISC_MTCH_AMT , SUM(EXT.PRC_PTCT_MTCH_DISC_AMT) PRC_PTCT_MTCH_DISC_AMT, SUM(EXT.UQ_QTY) UQ_QTY , COUNT(EXT.CLM_TYP_CD) CLM_TYP_CD --- added new as part of PSR.TF.10307 , SUM (CASE WHEN (ADMN_DISC_ADJ_AMT+ BASE_DISC_ADJ_AMT+ PERF_DISC_ADJ_AMT+ FRMLY_DISC_ADJ_AMT+ CTRC_DISC_ADJ_AMT+ PRC_PTCT_DISC_ADJ_AMT) <> 0 THEN CLM_TYP_CD ELSE 0 END) ADJ_RX_CNT_QTY --- added new as part of PSR.TF.10309 , SUM (COALESCE (EXT.CLM_TYP_MTCH_CD, 0)) MTCH_RX_CNT_QTY--- added new as part of PSR.TF.10309 , ASSC.RECN_GID, ASSC.RECN_OBJ_GID FROM VRAP.RCNT_RECN_EXTN_CLM EXT, VRAP.RCNT_RECN_CLM_ASSC ASSC, SESSION.RCNT_RECN_PARAM_TEMP PRM WHERE ASSC.RECN_GID = EXT.RECN_GID AND ASSC.INV_ID = EXT.INV_ID AND ASSC.HVST_ID = EXT.HVST_ID AND ASSC.CLM_GID = EXT.CLM_GID AND EXT.RECN_SCRB_CD <> $$PARM_SCRB_CD AND EXT.RECN_GID = PRM.RECN_GID AND ASSC.RECN_GID = PRM.RECN_GID AND ASSC.RECN_OBJ_TYP_CD = 1 GROUP BY ASSC.RECN_GID, ASSC.RECN_OBJ_GID ) OUT ON DSPTIN.RECN_GID = OUT.RECN_GID AND DSPTIN.RECN_DSPT_GID = OUT.RECN_OBJ_GID WHERE DSPT.RECN_GID = DSPTIN.RECN_GID AND DSPT.RECN_DSPT_GID = DSPTIN.RECN_DSPT_GID ) WHERE EXISTS ( SELECT 1 FROM (SELECT DISTINCT ASSC.RECN_OBJ_GID, ASSC.RECN_GID FROM VRAP.RCNT_RECN_CLM_ASSC ASSC, VRAP.RCNT_RECN_EXTN_CLM EXT, SESSION.RCNT_RECN_PARAM_TEMP PRM WHERE ASSC.RECN_GID = EXT.RECN_GID AND ASSC.INV_ID = EXT.INV_ID AND ASSC.HVST_ID = EXT.HVST_ID AND ASSC.CLM_GID = EXT.CLM_GID AND EXT.RECN_SCRB_CD = $$PARM_SCRB_CD AND EXT.RECN_GID = PRM.RECN_GID AND ASSC.RECN_GID = PRM.RECN_GID AND ASSC.RECN_OBJ_TYP_CD = 1 ) ASSIN WHERE DSPT.RECN_GID = ASSIN.RECN_GID AND DSPT.RECN_DSPT_GID = ASSIN.RECN_OBJ_GID );
