DROP TABLE SESSION.RCNT_RECN_PARAM_TEMP;
COMMIT;
-- Update the Match and Adjust amounts on VRAP.RCNT_RECN_HDR
MERGE INTO VRAP.RCNT_RECN_HDR HDR USING ( SELECT EXT.RECN_GID ,SUM(EXT.ADMN_DISC_MTCH_AMT + EXT.BASE_DISC_MTCH_AMT + EXT.PRC_PTCT_MTCH_DISC_AMT + EXT.CTRC_DISC_MTCH_AMT + EXT.PERF_DISC_MTCH_AMT + EXT.FRMLY_DISC_MTCH_AMT) as recn_tot_amt ,SUM(EXT.ADMN_DISC_ADJ_AMT + EXT.BASE_DISC_ADJ_AMT + EXT.PRC_PTCT_DISC_ADJ_AMT + EXT.CTRC_DISC_ADJ_AMT + EXT.PERF_DISC_ADJ_AMT + EXT.FRMLY_DISC_ADJ_AMT) as recn_adj_tot_amt FROM VRAP.RCNT_RECN_EXTN_CLM EXT, (SELECT DISTINCT RECN_GID from VRAP.RCNT_RECN_PARAM) PRM WHERE EXT.RECN_GID = PRM.RECN_GID AND EXT.RECN_SCRB_CD <> $$PARM_SCRB_CD GROUP BY EXT.RECN_GID ) REAPPLY ON ( HDR.RECN_GID = REAPPLY.RECN_GID ) WHEN MATCHED THEN UPDATE SET HDR.recn_tot_amt = REAPPLY.recn_tot_amt, HDR.recn_adj_tot_amt = REAPPLY.recn_adj_tot_amt;
COMMIT;

-- THERE ARE 7 UPDATES.
-- Update INV_ID on VRAP.RCNT_RECN_CLM_ASSC
MERGE INTO VRAP.RCNT_RECN_CLM_ASSC CLMOUT USING (SELECT distinct OLD.RECN_GID, OLD.HVST_ID, NEW.INV_ID NEW_INV, OLD.INV_ID OLD_INV FROM VRAP.RCNT_RECN_RETN_HVST_CV OLD, VRAP.RCNT_RECN_PARAM NEW where OLD.RECN_GID=NEW.RECN_GID AND OLD.HVST_ID = NEW.HVST_ID) CLMIN ON (CLMOUT.RECN_GID = CLMIN.RECN_GID AND CLMOUT.INV_ID = CLMIN.OLD_INV AND CLMOUT.HVST_ID = CLMIN.HVST_ID ) WHEN MATCHED THEN UPDATE SET CLMOUT.INV_ID = CLMIN.NEW_INV ;
COMMIT;
--UPDATE INV_ID ON RCNT_RECN_EXTN_CLM_AUDT
MERGE INTO VRAP.RCNT_RECN_EXTN_CLM_AUDT CLMOUT USING (SELECT distinct OLD.RECN_GID, OLD.HVST_ID, NEW.INV_ID NEW_INV, OLD.INV_ID OLD_INV FROM VRAP.RCNT_RECN_RETN_HVST_CV OLD, VRAP.RCNT_RECN_PARAM NEW where OLD.RECN_GID=NEW.RECN_GID AND OLD.HVST_ID = NEW.HVST_ID) CLMIN ON (CLMOUT.RECN_GID = CLMIN.RECN_GID AND CLMOUT.INV_ID = CLMIN.OLD_INV AND CLMOUT.HVST_ID = CLMIN.HVST_ID ) WHEN MATCHED THEN UPDATE SET CLMOUT.INV_ID = CLMIN.NEW_INV ;
COMMIT;
--UPDATE INV_ID ON RCNT_RECN_EXTN_CLM
MERGE INTO VRAP.RCNT_RECN_EXTN_CLM CLMOUT USING (SELECT distinct OLD.RECN_GID, OLD.HVST_ID, NEW.INV_ID NEW_INV, OLD.INV_ID OLD_INV FROM VRAP.RCNT_RECN_RETN_HVST_CV OLD, VRAP.RCNT_RECN_PARAM NEW where OLD.RECN_GID=NEW.RECN_GID AND OLD.HVST_ID = NEW.HVST_ID) CLMIN ON (CLMOUT.RECN_GID = CLMIN.RECN_GID AND CLMOUT.INV_ID = CLMIN.OLD_INV AND CLMOUT.HVST_ID = CLMIN.HVST_ID AND CLMOUT.RECN_SCRB_CD <> $$PARM_SCRB_CD ) WHEN MATCHED THEN UPDATE SET CLMOUT.INV_ID = CLMIN.NEW_INV ;
COMMIT;
